import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";

function rendasPDF(rendas) {
  pdfMake.vfs = pdfFonts.pdfMake.vfs;

  const reportTitle = [
    {
      image:
        "data:image/png;base64,",
      width: 100,
      height: 75,
      margin: [20, 20, 0, 45],
    },
  ];

  const dados = rendas.map((renda) => {
    return [
      { text: renda.descricaoReceita, fontSize: 9, margin: [0, 2, 0, 2] },
      {
        text: renda.isObjeto ? "Sim" : "Não",
        fontSize: 9,
        margin: [0, 2, 0, 2],
      },
      { text: renda.dataReceita, fontSize: 9, margin: [0, 2, 0, 2] },
      { text: renda.usuarioReceita, fontSize: 9, margin: [0, 2, 0, 2] },
      { text: renda.valor, fontSize: 9, margin: [0, 2, 0, 2] },
    ];
  });

  const rendaTotal = getRendaTotal();

  function getRendaTotal() {
    let rendaTemp = 0;
    rendas.forEach((renda) => {
      rendaTemp += renda.valor;
    });
    return rendaTemp;
  }

  function getDataAtual() {
    let date = new Date();
    let dia = String(date.getDay());
    let mes = String(date.getMonth());
    let ano = String(date.getFullYear());

    if (dia.length === 1) {
      dia = "0" + dia;
    }

    if (mes.length === 1) {
      mes = "0" + mes;
    }

    return dia + "/" + mes + "/" + ano;
  }

  const details = [
    {
      text: "Rendas da Hallel",
      fontSize: 18,
      bold: true,
      margin: [20, 60, 0, 20],
    },
    {
      table: {
        headerRow: 1,
        widths: ["*", "*", "*", "*", "*"],
        body: [
          [
            {
              text: "Descrição da receita",
              style: "tableHeader",
              fontSize: 10,
            },
            { text: "Objeto", style: "tableHeader", fontSize: 10 },
            { text: "Data da receita", style: "tableHeader", fontSize: 10 },
            { text: "Feito por", style: "tableHeader", fontSize: 10 },
            { text: "Valor", style: "tableHeader", fontSize: 10 },
          ],
          ...dados,
        ],
      },
    },
    {
      text: "Renda total: R$" + rendaTotal,
      fontSize: 12,
      bold: true,
      margin: [30, 20, 20, 0],
    },
    {
      text: "Emitido no dia: " + getDataAtual(),
      fontSize: 12,
      margin: [30, 20, 20, 0],
    },
  ];
  function Rodape(currentPage, pageCount) {
    return [
      {
        text: currentPage + "/" + pageCount,
        alignment: "right",
        fontSize: 9,
        margin: [0, 10, 20, 0],
      },
    ];
  }

  const docDefinitions = {
    pageSize: "A4",
    pageMargins: [15, 50, 15, 40],
    header: [reportTitle],
    content: [details],
    footer: Rodape,
  };

  pdfMake.createPdf(docDefinitions).download("Rendas da Hallel");
}

export default rendasPDF;
